import React from 'react'
import PostCard from '../PostCard';

export default function PostsContainer() {

  const postData = [
    {
      id: 1,
      title: 'The Journey Begins',
      description: 'An inspiring story about starting a new journey in life.',
      likes: 120
    },
    {
      id: 2,
      title: 'React Basics',
      description: 'A guide to understanding the fundamentals of React.',
      likes: 85
    },
    {
      id: 3,
      title: 'Exploring the World',
      description: 'Tips and tricks for traveling the globe.',
      likes: 200
    },
    {
      id: 4,
      title: 'Healthy Living',
      description: 'How to maintain a healthy lifestyle with balanced diet and exercise.',
      likes: 150
    },
    {
      id: 5,
      title: 'The Future of Technology',
      description: 'Predictions about the direction of tech in the next decade.',
      likes: 300
    },
    {
      id: 6,
      title: 'Learning JavaScript',
      description: 'A beginner-friendly tutorial on mastering JavaScript.',
      likes: 95
    },
    {
      id: 7,
      title: 'Cooking at Home',
      description: 'Delicious and easy-to-make recipes for home cooks.',
      likes: 110
    },
    {
      id: 8,
      title: 'Mindfulness and Meditation',
      description: 'An introduction to mindfulness and the benefits of meditation.',
      likes: 175
    },
    {
      id: 9,
      title: 'Photography Tips',
      description: 'How to take stunning photos with your smartphone.',
      likes: 225
    },
    {
      id: 10,
      title: 'Career Development',
      description: 'Strategies for advancing your career and finding new opportunities.',
      likes: 140
    }
  ];


  return (
    <div>
      {
        postData.map(el => <PostCard key={el.id} {...el} />)
      }
    </div>
  )
}
